import React from "react";
import "./style.css";
import { Table } from "reactstrap";
import Tabela from "./Tabela";

const Hall = (props) => {
  return (
    <Table responsive hover bordered striped className="bg-light">
      <thead>
        <tr>
          <th>#</th>
          <th>Nome</th>
          <th>Matrícula</th>
          <th>Batalhão Atual</th>
          <th>Estado Atual</th>
          <th>Batalhão de Interesse</th>
          <th>Estado de Interesse</th>
          <th>Combinar permuta </th>
        </tr>
        <Tabela />
      </thead>
    </Table>
  );
};

export default Hall;
